"    6-mercaptopurine metabolism",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 570px; height: 447px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The initial metabolism of 6-mercaptopurine occurs along the competing routes catalyzed by thiopurine methyltransferase (TPMT), xanthine oxidase (XO), and hypoxanthine phosphoribosyltransferase (HPRT). Further metabolism of the thionucleotide is catalyzed by inosine monophosphate dehydrogenase (IMPDH) and guanosine monophosphate synthetase (GMPS). The diphosphates and triphosphates are formed by their respective monophosphate (MPK) and diphosphate (DPK) kinases.",
