"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Tachycardia (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/tachycardia-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H10515875\">",
"      <span class=\"h1\">",
"       What is tachycardia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;&ldquo;Tachycardia&rdquo; is the medical term for a heartbeat that is faster than normal. Sometimes, a fast heartbeat is a normal response to exercising or feeling very worried. But other times, a fast heartbeat is a sign of another problem.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10515890\">",
"      <span class=\"h1\">",
"       What causes tachycardia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Exercising or feeling worried, stressed, or afraid can all cause tachycardia.",
"     </p>",
"     <p>",
"      Other things that can cause tachycardia include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Having too many drinks with caffeine, such as coffee, tea, or soda",
"       </li>",
"       <li>",
"        Smoking or using chewing tobacco",
"       </li>",
"       <li>",
"        Taking certain illegal drugs, such as cocaine",
"       </li>",
"       <li>",
"        Having a fever",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Problems with your heart&rsquo;s electrical system can also cause tachycardia. Some people are born with these problems. Other people get them because of high blood pressure, a heart attack, or other heart problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10515907\">",
"      <span class=\"h1\">",
"       What are the symptoms of tachycardia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people with tachycardia have no symptoms. But they might notice that their heart is beating fast, beating hard, or seems to skip a beat. These kinds of heartbeat changes are called &ldquo;palpitations.&rdquo;",
"     </p>",
"     <p>",
"      Sometimes, a fast heartbeat makes it harder for your heart to pump blood to your body. This can cause symptoms such as:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Dizziness",
"       </li>",
"       <li>",
"        Trouble breathing",
"       </li>",
"       <li>",
"        Chest pain",
"       </li>",
"       <li>",
"        Fainting",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10515922\">",
"      <span class=\"h1\">",
"       Is there a test for tachycardia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse will probably do a test called an electrocardiogram. This test, also known as an &ldquo;ECG&rdquo; or &ldquo;EKG,&rdquo; measures the electrical activity in your heart.",
"     </p>",
"     <p>",
"      You might also need other tests to see if another condition is causing your fast heartbeat.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10515937\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you have trouble breathing or have chest pain that lasts for more than a few minutes, call 9-1-1 for an ambulance.",
"     </p>",
"     <p>",
"      If you do not have these problems, but you often feel your heart beating fast or irregularly, talk to your doctor or nurse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10515952\">",
"      <span class=\"h1\">",
"       How is tachycardia treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The treatment depends on the cause of the tachycardia. When your heartbeat is very fast, your doctor might suggest ways to slow it down. He or she might have you cough, or bear down as if you&rsquo;re having a bowel movement. He or she might also put an ice pack on your face. Doing these things can affect the nerve that helps control your heartbeat.",
"     </p>",
"     <p>",
"      Other treatments can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines to control the speed or rhythm of your heartbeat",
"       </li>",
"       <li>",
"        A treatment called &ldquo;cardioversion&rdquo; that involves applying a mild electrical current to the heart to fix its rhythm",
"       </li>",
"       <li>",
"        A device called an &ldquo;implantable cardioverter defibrillator&rdquo; (&ldquo;ICD&rdquo; for short) that the doctor can put in your body. The ICD can help make your heart rhythm normal using mild electrical currents.",
"       </li>",
"       <li>",
"        A device called a pacemaker that the doctor can put in your body. The pacemaker sends electrical signals to your heart to control your heartbeat.",
"       </li>",
"       <li>",
"        Treatments called &ldquo;ablation.&rdquo; Ablation treatments use heat (called &ldquo;radiofrequency ablation&rdquo;) or cold (called &ldquo;cryoablation&rdquo;) to destroy the small part of the heart that is sending the abnormal electrical signals.",
"       </li>",
"       <li>",
"        Surgery to create scar tissue in the heart. This will block the flow of the electrical signals that make your heart beat abnormal.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10515967\">",
"      <span class=\"h1\">",
"       Can tachycardia be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If drinking too much caffeine or smoking caused your tachycardia, stopping those habits can prevent the problem.",
"     </p>",
"     <p>",
"      Heart disease can increase your chance of having tachycardia. Doing things that keep your heart healthy can help. This includes:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Eating lots of fruits and vegetables and low-fat dairy products, but not a lot of meat or fatty foods.",
"       </li>",
"       <li>",
"        Walking or doing a physical activity on most days of the week.",
"       </li>",
"       <li>",
"        Losing weight, if you are overweight.",
"       </li>",
"      </ul>",
"     </p>",
