var title_f5_34_5672="EPS tracing AVNRT dual AVN pathways I";
var content_f5_34_5672=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F60369&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F60369&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 597px\">",
"   <div class=\"ttl\">",
"    Electrophysiologic study (EPS) in a patient with atrioventricular nodal reentrant tachycardia and dual AV nodal pathways",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 577px; height: 448px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The tracing shows three surface ECG leads (I, II, V1) and intracardiac recordings from the high right atrium (HRA), bundle of His (HIS), right ventricular apex (RVA), and coronary sinus (CS). During atrial pacing (S1) at a cycle length of 600 ms (100 beats per minute); the AH interval is 120 ms. An atrial premature beat (S2) is added at a coupling cyle of 420 ms; this results in a prolongation of the PR interval and increase in the AH interval to 184 ms.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Martin Burke, DO.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
