" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Immunology of HIV-1 infection",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?5/34/5674/contributors\">",
