" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Knodell score (HAI score) of liver biopsy specimens for necrosis, inflammation, and fibrosis*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        I. Periportal &plusmn; bridging necrosis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Score",
"       </td>",
"       <td class=\"subtitle1\">",
"        II. Intralobular degeneration and focal necrosis&bull;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Score",
"       </td>",
"       <td class=\"subtitle1\">",
"        III. Portal inflammation",
"       </td>",
"       <td class=\"subtitle1\">",
"        Score",
"       </td>",
"       <td class=\"subtitle1\">",
"        IV. Fibrosis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Score",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        None",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        None",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        No portal inflammation",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        No fibrosis",
"       </td>",
"       <td>",
"        0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mild piecemeal necrosis",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        Mild (acidophilic bodies, ballooning degeneration and/or scattered",
"foci of hepatocellular necrosis in &lt; 1/3 of lobules or nodules",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        Mild (sprinkling of inflammatory cells in &lt;1/3 of portal tracts)",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        Fibrous portal expansion",
"       </td>",
"       <td>",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Moderate piecemeal necrosis (involves less than 50 percent of the circumference of most portal tracts)",
"       </td>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        Moderate (involvement of 1/3 to 2/3 of lobules or nodules)",
"       </td>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        Moderate (increased inflammatory cells in 1/3 to 2/3 of portal tracts)",
"       </td>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        Bridging fiborisis (portal-portal or portal- central linkage)",
"       </td>",
"       <td>",
"        3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Marked piecemeal necrosis (involves more than 50 percent of the circumference of most portal tracts)",
"       </td>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        Marked (involvement of &gt;2/3 of lobules or nodules)",
"       </td>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        Marked (dense packing of inflammatory cells in &gt;2/3 of portal tracts)",
"       </td>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        Cirrhosis&Delta;",
"       </td>",
"       <td>",
"        4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Moderate piecemeal necrosis plus bridging necrosis &loz;",
"       </td>",
"       <td>",
"        5",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Marked piecemeal necrosis plus bridging necrosis &loz;",
"       </td>",
"       <td>",
"        6",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Multilobular necrosis &sect;",
"       </td>",
"       <td>",
"        10",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
